import React from 'react';
import Tilt from 'react-tilt'
import './Logo.css';

const Logo = () => {
  return (
    <div className='ma4 mt0'>
      <Tilt className="Tilt br2 shadow-2" options={{ max : 55 }} style={{ height: 150, width: 150 }} >
        <div className="Tilt-inner"><img src="https://img.icons8.com/ios/50/000000/face-id.png" alt='Face'/></div>
      </Tilt>

    </div>
  );
}

export default Logo;
